import React from 'react';
import styles from './slide.module.css';
import Icons from '../assets/icons/icons';
import CustomButton from '../utils/CustomButton'
export default function Slide(props){
    return (
<div class="container mt-5 slide" >
    <div class="row h-100">
      <div class="col-md-7 h-100 test">
          <div class="holder-chontainer d-flex flex-start flex-column ">
              <div className={styles.square_element}>
              <Icons icon="square" width='20' height='20'/>
              </div>
              <h1 class="w-25">Webshop <span class="d-block">Bouwmaterialen</span></h1>
              <h4 class="d-flex">Budujemy lepszą przyszłość</h4>
              <CustomButton title={'Zamów materiały'}/>
          </div>
      </div>
      <div className="col-md-5"></div>
    </div>
</div>



    );
}
